import React from "react";
import "./MealItemForm.css";
import Input from "../../UI/Input";
const MealItemForm = () => {
  return (
    <form className="form">
      <Input
        label="Amount"
        input={{
          id: "amount_",
          type: "number",
          min: "0",
          max: "5",
          step: "1",
          defaultValue: "0",
        }}
      />
      {/* <button>Add</button> */}
    </form>
  );
};

export default MealItemForm;
